package com.ef.bite.dataacces.mode;

public class VoiceReviewrs {
	private String avatar_url;
	private String voice_review_id;
	private String given_name;
	private String family_name;
	private String bella_id;
	public VoiceReviewrs() {
		// TODO Auto-generated constructor stub
	}
	public String getAvatar_url() {
		return avatar_url;
	}
	public void setAvatar_url(String avatar_url) {
		this.avatar_url = avatar_url;
	}
	public String getVoice_review_id() {
		return voice_review_id;
	}
	public void setVoice_review_id(String voice_review_id) {
		this.voice_review_id = voice_review_id;
	}
	public String getGiven_name() {
		return given_name;
	}
	public void setGiven_name(String given_name) {
		this.given_name = given_name;
	}
	public String getFamily_name() {
		return family_name;
	}
	public void setFamily_name(String family_name) {
		this.family_name = family_name;
	}
	public String getBella_id() {
		return bella_id;
	}
	public void setBella_id(String bella_id) {
		this.bella_id = bella_id;
	}
	
}
